int asn1PrtToStrm_PollingInfo (OSCTXT *pctxt, 
   const char* name, const PollingInfo* pvalue)
{
   rtPrintToStreamOpenBrace (pctxt, name);

   if (pvalue->m.timerPollProhibitPresent) {
      asn1PrtToStrm_TimerPollProhibit (pctxt, "timerPollProhibit", &pvalue->timerPollProhibit);
   }

   if (pvalue->m.timerPollPresent) {
      asn1PrtToStrm_TimerPoll (pctxt, "timerPoll", &pvalue->timerPoll);
   }

   if (pvalue->m.poll_PDUPresent) {
      asn1PrtToStrm_Poll_PDU (pctxt, "poll_PDU", &pvalue->poll_PDU);
   }

   if (pvalue->m.poll_SDUPresent) {
      asn1PrtToStrm_Poll_SDU (pctxt, "poll_SDU", &pvalue->poll_SDU);
   }

   rtPrintToStreamIndent (pctxt);
   rtPrintToStreamBoolean (pctxt, "lastTransmissionPDU_Poll", pvalue->lastTransmissionPDU_Poll);

   rtPrintToStreamIndent (pctxt);
   rtPrintToStreamBoolean (pctxt, "lastRetransmissionPDU_Poll", pvalue->lastRetransmissionPDU_Poll);

   if (pvalue->m.pollWindowPresent) {
      asn1PrtToStrm_PollWindow (pctxt, "pollWindow", &pvalue->pollWindow);
   }

   if (pvalue->m.timerPollPeriodicPresent) {
      asn1PrtToStrm_TimerPollPeriodic (pctxt, "timerPollPeriodic", &pvalue->timerPollPeriodic);
   }

   rtPrintToStreamCloseBrace (pctxt);
   return 0;
}

